"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Tourette syndrome (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/tourette-syndrome-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H10195103\">",
"      <span class=\"h1\">",
"       What is Tourette syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Tourette syndrome is a rare disorder that causes people to make unusual movements or sounds, called &ldquo;tics.&rdquo; Common examples of tics include blinking and throat clearing. People with the disorder have little or no control over their tics. Many people with Tourette syndrome have mild symptoms, but some have more severe ones.",
"     </p>",
"     <p>",
"      Most people with Tourette syndrome start showing signs of the disorder before they are 11 years old. In about half of children with Tourette syndrome, the tics go away by the time they turn 18. But in some people, the tics return later in life.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195118\">",
"      <span class=\"h1\">",
"       What are the symptoms of Tourette syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Motor tics &ndash; These are tics that involve unusual movements. They can be mild (called &ldquo;simple motor tics&rdquo;) or more extreme (called &ldquo;complex motor tics&rdquo;). Examples of motor tics include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Blinking",
"       </li>",
"       <li>",
"        Briefly making a face as if angry or in pain (called a &ldquo;grimace&rdquo;)",
"       </li>",
"       <li>",
"        Shrugging the shoulders",
"       </li>",
"       <li>",
"        Jerking the head",
"       </li>",
"       <li>",
"        Walking in a strange way",
"       </li>",
"       <li>",
"        Kicking, jumping, or moving the body in odd ways",
"       </li>",
"       <li>",
"        Scratching",
"       </li>",
"       <li>",
"        Making obscene gestures",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Vocal tics &ndash; These are tics that involve unusual sounds or words, or phrases that don&rsquo;t make sense or seem odd. Examples include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Throat-clearing, grunting, or other noises",
"       </li>",
"       <li>",
"        Swearing",
"       </li>",
"       <li>",
"        Repeating words or phrases (including echoing what other people say)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People with Tourette syndrome often know that they are going to have a tic before it happens.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195133\">",
"      <span class=\"h1\">",
"       Is there a test for Tourette syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. There is no test. But your doctor or nurse should be able to tell if you or your child has it by learning about the symptoms. Most people with Tourette syndrome have a normal physical exam. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195148\">",
"      <span class=\"h1\">",
"       How is Tourette syndrome treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Children and adults with Tourette syndrome don&rsquo;t need medical treatment unless their tics are severe. A person with Tourette syndrome might need treatment if he or she is having problems:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Talking with other people",
"       </li>",
"       <li>",
"        Attending school or working at a job",
"       </li>",
"       <li>",
"        Doing everyday things such as bathing, dressing, and eating",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines &ndash; Certain medicines used to treat different mental health conditions can lower the number of tics a person has.",
"       </li>",
"       <li>",
"        Botulinum toxin (brand name: Botox&reg;) &ndash; This is a medicine that is given by injection. It works by blocking or calming the nerve signals that make the muscles jerk or twitch.",
"       </li>",
"       <li>",
"        Habit reversal training &ndash; This treatment involves working with a therapist, who teaches people with Tourette syndrome to recognize when they are about to have a tic. Then, the people train themselves to do a different movement that makes it hard to do the tic. This treatment is not available everywhere.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195163\">",
"      <span class=\"h1\">",
"       How can I learn more about Tourette syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;More information is available online from the Tourette Syndrome Association at",
"      <a class=\"external\" href=\"file://www.tsa-usa.org/\">",
"       www.tsa-usa.org",
"      </a>",
"      . It&rsquo;s also important to make sure that family, friends, teachers, and co-workers of people with Tourette syndrome learn about the disorder.",
"     </p>",
"    </div>",
