"     <a class=\"medical medical_review\" href=\"UTD.htm?41/32/42503?source=related_link\">",
"      Treatment of acute pulmonary embolism",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?42/4/43082?source=related_link\">",
"      Treatment of lower extremity deep vein thrombosis",
"     </a>",
"    </li>",
"   </ul>",
