var title_f16_28_16844="Tests for anaphylaxis mediators";
var content_f16_28_16844=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F69698&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F69698&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Available tests for the evaluation of anaphylaxis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Test",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"       <td class=\"subtitle1\">",
"        Availability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Total tryptase (serum/plasma)",
"       </td>",
"       <td>",
"        <p>",
"         Mature + pro forms of &alpha;/&beta;-tryptases.",
"        </p>",
"        <p>",
"         Maximal elevation above baseline 15 to 60 minutes after onset of anaphylaxis; declines to baseline with a t",
"         <sub>",
"          1/2",
"         </sub>",
"         of ~2 hours.",
"        </p>",
"        <p>",
"         Comparing acute and baseline levels improves sensitivity and specificity.",
"        </p>",
"       </td>",
"       <td>",
"        Thermo Fisher Scientific Inc. (many commercial labs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mature tryptase (serum/plasma)",
"       </td>",
"       <td>",
"        <p>",
"         Mature tryptase.",
"        </p>",
"        <p>",
"         Peaks 15 to 60 minutes after the onset of anaphylaxis and then declines with a t",
"         <sub>",
"          1/2",
"         </sub>",
"         of ~2 hours.",
"        </p>",
"       </td>",
"       <td>",
"        Virginia Commonwealth University*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Histamine (plasma)",
"       </td>",
"       <td>",
"        <p>",
"         Peaks 5 to 10 minutes after symptom onset and declines to baseline by 15 to 30 minutes.",
"        </p>",
"        <p>",
"         Histamine may be released",
"         <em>",
"          ex vivo",
"         </em>",
"         by passing basophils in blood through a small-bore needle under vacuum or when blood clots.",
"        </p>",
"       </td>",
"       <td>",
"        Most commercial labs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Histamine (24 hour urine)",
"       </td>",
"       <td>",
"        May be elevated in urine collected up to 24 hours after symptom onset, but histamine-containing foods and histamine-producing mucosal bacteria may be problematic.",
"       </td>",
"       <td>",
"        Most commercial labs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N-methylhistamine (24 hour urine)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Some commercial labs (Mayo Clinic)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N-methylimidazole acetic acid (24 hour urine)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Research labs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        11-beta-prostaglandin F-2-alpha (24 hour urine)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Research labs",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Available in author's laboratory (LBS).",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
