var title_f16_28_16845="Open globe rapid overview";
var content_f16_28_16845=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F50022&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F50022&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Overview of open globe injury",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        May accompany multiple trauma or serious head injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Open globe laceration is considered a tetanus prone wound",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Open globe rupture may be occult",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Inspection (with penlight or preferably a slit lamp):",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Obvious corneal or scleral laceration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Volume loss to eye",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Uveal (iris or ciliary body) prolapse",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Other iris abnormalities (peaked pupil or eccentric pupil)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; 360 degree, bullous subconjunctival hemorrhage (posterior rupture)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Intraocular or protruding foreign body",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Decreased visual acuity by Snellen or handheld chart, assess counting fingers, hand motion or light perception if unable to see chart",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Relative afferent pupillary defect by swinging penlight technique*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diagnostic evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Immediate ophthalmology consultation for comprehensive eye examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        CT scan: non-contrast 1 to 2 mm cuts axial and coronal through the orbits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Other studies based on presence and degree of traumatic injury to other anatomical regions (eg, head, thorax, abdomen)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Initial treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ensure nothing by mouth (NPO)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess and treat life-threatening injuries",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Avoid high dose ketamine if rapid sequence induction (RSI) is required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        If RSI is necessary, rocuronium is preferred to succinylcholine for muscle relaxation, although succinylcholine may be used with dexmedetomidine premedication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Do not remove any protruding foreign bodies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Avoid eye manipulation that will increase intraocular pressure (eg, lid retraction, intraocular pressure measurement, ocular ultrasound)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Place eye shield after initial eye examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Put patient on bed rest with head of bed elevated to 30 degrees if hemodynamic condition allows",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Treat nausea and vomiting aggressively (eg, ondansetron 0.15 mg/kg per dose: Maximum dose 12 mg, intravenously)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide sedation, as needed (eg, lorazepam 0.05 mg/kg, maximum dose: 2 mg)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide analgesia (eg, IV fentanyl [1 mcg/kg per dose, maximum initial dose: 100 mcg] or morphine [0.1 mg/kg per dose, maximum initial dose: 10 mg])",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Do NOT give any eye drops (eg, fluorescein, tetracaine, cycloplegics)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Begin IV antibiotics:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Vancomycin (15 mg/kg IV, maximum dose: 1.5 grams)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Ceftazidime (50 mg/kg IV, maximum dose: 2 grams)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Fluoroquinolone for penicillin allergic patients (eg, Ciprofloxacin 10 mg/kg IV, maximum dose: 400 mg, Use with caution in patients under 18 years of age)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ensure definitive management by an ophthalmologist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Urgent surgical repair, ideally within 24 hours of injury",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * See \"Open globe injuries: Emergent evaluation and initial management, section on Reletive afferent pupillary defect\".",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
